import React from "react";
import Sidebar from "../components/Sidebar";
import Footer from "../components/Footer";

const SafetyTipsPage = () => {
  return (
    <div className="min-h-screen bg-[#0a1124] text-white pt-24 px-24 md:px-0">

      {/* MAIN LAYOUT */}
      <div className="flex flex-col md:flex-row gap-6 max-w-7xl mx-auto">

        {/* SIDEBAR */}
        <Sidebar />

        {/* RIGHT CONTENT */}
        <div className="flex-1 bg-[#111827] p-4 md:p-6 rounded-xl shadow-lg space-y-6">

          {/* Heading */}
          <h2 className="text-2xl md:text-3xl font-semibold mb-4">
            Safety Tips
          </h2>

          {/* ---------- REUSABLE CARD ---------- */}
          {[
            {
              title: "Watch out for email scams",
              desc: "Be cautious of emails asking for personal information. Scammers often pretend to be trusted companies."
            },
            {
              title: "Pay with a credit card",
              desc: "Credit cards offer better fraud protection than other payment methods. Always choose secure payments."
            },
            {
              title: "Check your statements",
              desc: "Regularly review your statements to detect unauthorized transactions early."
            },
            {
              title: "Report the company",
              desc: "If a company seems suspicious or has scammed you, report it immediately."
            }
          ].map((item, i) => (
            <div
              key={i}
              className="bg-[#0f1a30] border border-gray-700 p-5 rounded-xl hover:bg-[#15203a] transition shadow-md space-y-3"
            >
              {/* Top Row */}
              <div className="flex justify-between items-center">
                <h2 className="text-xl md:text-2xl font-semibold">
                  {item.title}
                </h2>

                <button className="px-3 py-1 bg-blue-600 hover:bg-blue-700 rounded text-sm">
                  Edit
                </button>
              </div>

              {/* Divider */}
              <div className="w-full h-px bg-gray-700"></div>

              {/* Description */}
              <p className="text-gray-300 text-sm md:text-base">{item.desc}</p>

              {/* View More */}
              <button className="text-blue-400 hover:text-blue-300 underline text-sm">
                View More
              </button>
            </div>
          ))}
        </div>
      </div>

      {/* FOOTER */}
      <div className="mt-10 px-4 md:px-0">
        <Footer />
      </div>
    </div>
  );
};

export default SafetyTipsPage;
